import React from "react";
import Login from "./Pages/login";
import { Route, Routes } from "react-router-dom";

const Router = () => {
  return (
    <div className="App">
      <Routes>
        <Route path="/" exact element={<Login />} />
      </Routes>
    </div>
  );
};

export default Router;
